import React from "react";
import "./App.css";

const Swapi = ({hero, starships}) => {

  return <div className="swapi">
      <p>{hero}</p>
      <br />
      <ol key={starships}>{starships.map((starship) => (
      <li >{starship.name}</li>))}</ol>
    </div>;
};

export default Swapi;
